import React, { useEffect, useState } from 'react';
import axios from 'axios';
import EventsHeader from './EventsHeader';
import Navigation from '../Navigation';
import SideMenu from '../SideMenu';
const Events = () => {
    // test with zipCode -> cleanUrls with urls array
    const [zipCode, setZipCode] = useState("94109")
    const [urlData, setUrlData] = useState([]);
    const [cleanUrlData, setCleanUrlData] = useState([]);

    useEffect(() => {
        axios.get("/test", {params: { zipCode: zipCode} })
        .then((response) => {
            setUrlData(response.data)
            console.log(response.data);
        })
        .catch((error) => {
            console.log(error);
        })


    }, [])
    //#endregion
    useEffect(() => {

        axios.get("/cleanUrls", {params: { urls: urlData } })
        .then((response) => {
            setCleanUrlData(response.data)
        })
        .catch((error) => {
            console.log(error);
        })
    }, [urlData])
    //#endregion
    useEffect(() => {
        Promise.all(cleanUrlData).then((resp) => {
            console.log(resp);
        })
        .catch((err) => {
            console.log(err);

        })
    }, [cleanUrlData])

    return (
        <div>
            <Navigation />
            <EventsHeader />
            <SideMenu />
            <div>

            </div>
        </div>
    );
};

export default Events;
